import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import App from '/.App'
import './index.css'

class Apple extends Component {
    render () {
        return (
            <div className="App">
                <h1>Hello Batya!</h1>
            </div>
        )
    }
}

ReactDOM.render(<App />,document.getElementById('root'))
